import './style.css';


  function Title(props) {

    return (


      <div className="title-div">

        <img className="photo" src={props.photo}></img>

        <h1>{props.name}</h1>

        <p id="intro">{props.intro}</p>

      </div>
      
    )



  }


  export default Title;
